iterations.yara_rule:
rule EvasionBypass {
    meta:
        description = "Evasion bypass detection for large offset calls"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 85 C0 FF ?? F8 E8 ?? ?? }
        $pattern1 = { 6A 5A 8B CE ?? ?? E8 C8 ?? }
        $pattern2 = { FF ?? F0 8B ?? 20 0F 74 E8 }

    condition:
        any_of($pattern0, $pattern1, $pattern2)
}

